function Posts ({data}){
    console.log(data);
    return (
        <table border={1}>
        <thead>
            <tr>
                <th>Id</th>
                <th>Title</th>
                <th>Action</th>
            </tr>
        </thead>
        <tbody>
           {!data ? <></> : data.map((item)=>{
            // console.log(item);
            return <tr key={item.id}>
                <td>{item.id}</td>
                <td>{item.title}</td>
            </tr>
           })}
        </tbody>
        </table>
    )
}
export default Posts
